import { useEffect, useState } from "react";

function Wishlist(){
    const [data,setData] = useState([]);
    console.log(data)
    useEffect(()=>{
        axios.get("http://localhost:8080/laravel8/laravel8/public/api/product/wishlist")
        .then(res=>{
            setData(res.data.data)
        })
    },[]);

    return(
       <p>Wl</p>
    )
}
export default Wishlist;
